import React, { useEffect, useState } from 'react'

const FetchApi = () => {

    const [users, setUsers] = useState([]);



    const getUsers = async () => {
        const response = await fetch("https://api.github.com/users");
        // const data=await response.json();
        // console.log(data);
        const FinalData = await response.json();
        setUsers(FinalData)
    }



    useEffect(() => {
        getUsers();
    }, [])


    return (
      
            <div className="container">
               
                {
                    users.map((CurrentData) => {
                        return (
                            <div className="userName">
                                <h5>Login ID: {CurrentData.login}</h5>
                            <div className="card_item" key={CurrentData.id}>
                            <h5>Node ID:</h5>{CurrentData.node_id}

                                <div className="card_inner">
                                        <img src={CurrentData.avatar_url}/>
                                        <h5>GRAVATAR ID: {CurrentData.gravatar_id}</h5>
                                        <div className="userUrl">USER URL: {CurrentData.url}</div>
                                        <div className="htmlUrl">HTML URL: {CurrentData.html_url}</div>
                                        <div className="gistsUrl">GISTS URL:{CurrentData.gists_url}</div>
                                        <div className="Starred Url">STARRED URL:{CurrentData.starred_url}</div>
                                        <div className="Subscription Url">SUBSCRIPTION URL:{CurrentData.subscriptions_url}</div>
                                        <div className="OrganizationsUrl">ORGANIZATION URL:{CurrentData.organizations_url}</div>
                                        <div className="Repos Url">REPOS URL:{CurrentData.repos_url}</div>
                                        <div className="Events Url">EVENTS URL:{CurrentData.events_url}</div>
                                        <div className="Received Events Url">RECEIVED EVENTS URL:{CurrentData.received_events_url}</div>
                                      <h5>Type:{CurrentData.type}</h5>
                                      <h5> Site_ Admin:{CurrentData.site_admin}</h5>
                                       
                                
                                </div>

                            </div>
                            </div>
                        )
                    })
                }

            </div>              


    )
}

export default FetchApi;
